import React, { useEffect, useState } from "react";
import { parse } from "qs";

const App = () => {
  useEffect(() => {});

  return (
    <>
      <div className="app">
        <input
          type="text"
          id="password-output"
          value="Générateur de Mdp"
          readOnly
        />

        <div className="range-container">
          <input
            type="range"
            name=""
            id="password-length"
            min="4"
            max="24"
            value="8"
          />
        </div>
      </div>
    </>
  );
};

export default App;
